<?php

class Solution
{

    /**
     * @param String $senate
     * @return String
     */
    function predictPartyVictory($senate)
    {
        $r = [];
        $d = [];
        for ($i = 0, $len = strlen($senate); $i < $len; ++$i) {
            if ($senate[$i] === 'R') {
                $r[] = $i;
            } else {
                $d[] = $i;
            }
        }

        while (!empty($r) && !empty($d)) {
            $rItem = array_shift($r);
            $dItem = array_shift($d);
            if ($rItem < $dItem) {
                $r[] = $len + $rItem;
            } else {
                $d[] = $len + $dItem;
            }
        }

        return empty($r) ? 'Dire' : 'Radiant';
    }
}

var_dump(
    (new Solution())->predictPartyVictory(
        ''
    )
);